import React from "react";
import styled from "styled-components";

const NavbarWrapper = styled.nav`
  width: 100%;
  background-color: #3E2723;

`;

const Navbar = ({children}) => (
    <NavbarWrapper>
        {children}
    </NavbarWrapper>
);

export default Navbar;
